atomicData::atomicData(const std::string &dataLine) {
  boost::char_separator<char> spaceSep(" \t");
  tokenizer tokens(dataLine, spaceSep);
  tokenizer::iterator token = tokens.begin();
  std::istringstream istr;
  istr.imbue(std::locale("C"));

  // atomic number first
  istr.clear();
  istr.str(*token);
  istr >> anum;
  ++token;

  // use atomic number to set element name
  name = elementNames[anum];

  // element symbol
  symb = *token;
  ++token;

  // covalent radius
  istr.clear();
  istr.str(*token);
  istr >> rCov;
  ++token;

  // rB0
  istr.clear();
  istr.str(*token);
  istr >> rB0;
  ++token;

  //  Van derWaal radius
  istr.clear();
  istr.str(*token);
  istr >> rVdw;
  ++token;

  // atomic mass
  istr.clear();
  istr.str(*token);
  istr >> mass;
  ++token;

  // number of outshell electrons
  istr.clear();
  istr.str(*token);
  istr >> nVal;
  ++token;

  // most common isotope
  istr.clear();
  istr.str(*token);
  istr >> commonIsotope;
  ++token;

  // most common isotopic mass
  istr.clear();
  istr.str(*token);
  istr >> commonIsotopeMass;
  ++token;

  // now the valences
  valence.clear();
  while (token != tokens.end()) {
    istr.clear();
    istr.str(*token);
    int tval;
    istr >> tval;
    valence.push_back(tval);
    ++token;
  }
}

